import React, { Component } from "react";
import Images from './Images.jsx';

class List extends Component {

    render() {
        return(
            <div>
                <ol>
                    <li>1i</li>
                    <li>2</li>
                    <li>3</li>
                    <li>4</li>
                </ol>
            </div>
        );
    }
}
export default List;
